import React from 'react';
import CrudTable from '../components/CrudTable';
import { reportApi } from '../services/api';

const fields = [
  { key: 'reportId', label: 'ID', noForm: true },
  { key: 'patientId', label: 'Patient ID', type: 'number' },
  { key: 'doctorId', label: 'Doctor ID', type: 'number' },
  { key: 'reportDate', label: 'Report Date', type: 'date' },
  { key: 'reportType', label: 'Report Type', placeholder: 'e.g. Blood Test, X-Ray' },
  { key: 'summary', label: 'Summary', placeholder: 'Report summary...' },
  { key: 'status', label: 'Status', placeholder: 'Normal / Abnormal / Pending' },
];

export default function Reports() {
  return (
    <div>
      <h1 style={{ fontFamily: "'DM Serif Display', serif", fontSize: 26, marginBottom: 6 }}>Reports</h1>
      <p style={{ color: 'var(--text-light)', marginBottom: 24, fontSize: 14 }}>Medical reports stored securely for future reference</p>
      <CrudTable title="Reports" fields={fields} api={reportApi} idField="reportId" />
    </div>
  );
}
